Do you take art supplies on vacations? I may not be the most organized packer, but I put a lot of thought into my little container of art supplies! (There’s always time for collage + altered book art!) Prepared a little kid board book with gesso and snatched a bunch of vintage, dyed, and scrap tissue paper. Going small with collage was a very different experience from the larger sizes I usually make! 
🧴I also brought a small tube of gel matte medium which works great as a glue. Didn’t want to haul my giant 132 oz. bottle of Mod Podge! 
🪑Our hotel had a small table which was just big enough to work on, so I got a couple hours of artistic work in. 
🦅 But since it’s me I also got a LOT of birding in! Cape Cod is beautiful, and I saw an Osprey with a fresh 🐟 in its talons, a few White Egrets, and some adorable Willets. 
[even went to the first Tea Dance 🪩 and took in the Illusions Drag Show here in Provincetown - it was a blast!!]
