I’ve been using vintage books pages, most found in giveaway boxes on the streets of NYC, for a majority of my artwork lately. This week I found a book called The Joys Of Yiddish and it has been a delightful inspiration. (The reel I posted earlier today shows the process). The type melts into a dainty pattern and provides a background foundation for watercolor and acrylic to float on top. I’m also learning more about Yiddish and Jewish history as I choose pages. What do you think?
